	@note nvarchar(50),
	@date DateTime,
	@ID int out
AS

Begin
INSERT INTO [dbo].[ProductsDetails](
            [prodId],
			[purchId],
			[cost],
			[price],
			[quantity],
			[expireDate]
			) 
            VALUES (
			@prodId,
			@purchId,
			@cost,
	        @price,
			@quantity,
	        @exDate
			);
INSERT INTO [dbo].[PurchasesItems](
			[purchId],
            [proddId],
            [prodId],
			[price],
			[quantity]
			)
            VALUES (
			@purchId,
			IDENT_CURRENT('ProductsDetails'),
			@prodId,
			@cost,
			@Quantity
			);
EXEC IncDecProdQuantity @proId=@prodId,@value=@quantity;
End

CREATE PROCEDURE [dbo].[AddPurchaseItem]
    @purchId int,
	@prodId int,
	@cost real,
	@price real,
	@quantity real,
	@exDate Date
AS

Begin
INSERT INTO [dbo].[PurchasesItems](
            [dbo].[PurchasesItems].purchId,
			[dbo].[PurchasesItems].prodId,
			[dbo].[PurchasesItems].proddId,
			[dbo].[PurchasesItems].price,
			[dbo].[PurchasesItems].quantity
			) 
			VALUES (
			@purchId,
			@prodId,
			@proddId,
			@price,
			@quantity
			);

SET @quantity = @quantity * -1
EXEC IncDecProdDQuantity @id=@proddId, @value=@quantity;
EXEC IncDecProdQuantity @proId=@prodId, @value=@quantity;
End

