CREATE PROCEDURE [dbo].[AddUser] 
	@name nchar(10),
	@password nchar(10),
	@empId int,
	@permId int
	
AS

Begin CREATE TABLE [dbo].[JobTitle] ( [Id] INT NOT NULL PRIMARY KEY IDENTITY(1,1), [name] NVARCHAR(50) NOT NULL UNIQUE, [description] NVARCHAR(50) NOT NULL );
CREATE TABLE [dbo].[Employees] ( [Id] INT NOT NULL PRIMARY KEY IDENTITY(1,1), [name] NVARCHAR(50) NOT NULL UNIQUE, [NIC] INT NOT NULL, [birthDate] DATE NOT NULL, [address] NVARCHAR(50) NOT NULL, [jobTitleId] INT NOT NULL, [basicSalary] REAL NOT NULL, [genderId] INT NOT NULL, [phone] NVARCHAR(50) NOT NULL, [note] NVARCHAR(50) NOT NULL, CONSTRAINT [FK_Employees_SalesOp] FOREIGN KEY([jobTitleId]) REFERENCES [dbo].[JobTitle] ([Id]), CONSTRAINT [FK_Employees_Gender] FOREIGN KEY([genderId]) REFERENCES [dbo].[Gender] ([Id]) );
INSERT INTO [dbo].[JobTitle] ([dbo].[JobTitle].[name],[dbo].[JobTitle].[description]) VALUES ('Owner','Owner'); INSERT INTO [dbo].[Employees] ( [dbo].[Employees].[name], [dbo].[Employees].[NIC], [dbo].[Employees].[birthDate], [dbo].[Employees].[address], [dbo].[Employees].[jobTitleId], [dbo].[Employees].[basicSalary], [dbo].[Employees].[genderId], [dbo].[Employees].[phone], [dbo].[Employees].[note] )VALUES( 'Owner', 1000001, '2000-1-1', 'no place', 1, 0, 1, '+967', 'Owner' ); End

Begin

CREATE TABLE [dbo].[Permission]
(
	[Id] INT NOT NULL PRIMARY KEY IDENTITY(1,1), 
    [name] NVARCHAR(10) NOT NULL UNIQUE
);
INSERT INTO [dbo].[Permission] ([dbo].[Permission].name)VALUES('Owner');
INSERT INTO [dbo].[Permission] ([dbo].[Permission].name)VALUES('Admin');
INSERT INTO [dbo].[Permission] ([dbo].[Permission].name)VALUES('SaleSt');
INSERT INTO [dbo].[Permission] ([dbo].[Permission].name)VALUES('PurchaseSt');
CREATE TABLE [dbo].[Users]
(
	[Id] INT NOT NULL PRIMARY KEY IDENTITY(1,1), 
    [name] NVARCHAR(10) NOT NULL UNIQUE, 
    [password] NVARCHAR(10) NOT NULL UNIQUE, 
    [empId] INT NOT NULL UNIQUE, 
    [permId] INT NOT NULL,
    CONSTRAINT [FK_Users_Emp] FOREIGN KEY([empId]) REFERENCES [dbo].[Employees] ([Id]),
    CONSTRAINT [FK_Users_Perm] FOREIGN KEY([permId]) REFERENCES [dbo].[Permission] ([Id])
);
INSERT INTO [dbo].[Users] (
            [dbo].[Users].name,
            [dbo].[Users].password,
            [dbo].[Users].empId,
            [dbo].[Users].permId
            )VALUES(
            'Owner',
            'Owner',
            1,1
            );

End

Begin
UPDATE dbo.ProductsDetails SET dbo.ProductsDetails.quantity = dbo.ProductsDetails.quantity + @value WHERE dbo.ProductsDetails.Id = @id;
End

Begin
UPDATE dbo.Products SET dbo.Products.totalQuantity = dbo.Products.totalQuantity + @value WHERE dbo.Products.Id = @proId;
End

